import React from 'react';
import { Container, Col, Row } from 'reactstrap';
import './landing.css'
const Landing = (props) => {
	return (
		<Container>
			<Row>
				<Col md="8">
					<img className="homeImg" src="https://www.trends.fr/wp-content/uploads/2016/12/nike-uptempo-black-pack-5-1800x1200.jpg" />
				</Col>
				<Col md="4">
					<img className="homeImg" src="https://i.pinimg.com/originals/72/f0/7f/72f07f2113f5922c684372082acf3062.jpg" />
				</Col>
			</Row>
		</Container>
	);
};

export default Landing;
